from typing import List
from collections import defaultdict
import bisect

class Solution:
    def maxProfitAssignment(self, difficulty: List[int], profit: List[int], worker: List[int]) -> int:
        hsh = defaultdict(int)
        for d, p in zip(difficulty, profit):
            if p > hsh[d]:
                hsh[d] = p
        arr = sorted([[k, v] for k, v in hsh.items()])
        for i in range(1, len(arr)):
            arr[i][1] = max(arr[i-1][1], arr[i][1])
        diff = [d for d, p in arr]
        prft = [p for d, p in arr]
        res = 0
        for w in worker:
            i = bisect.bisect_left(diff, w)
            if i == 0 and diff[i] != w:
                continue
            if i == len(diff):
                res += prft[i - 1]
            elif diff[i] == w:
                res += prft[i]
            else:
                res += prft[i-1]
        return res

